/** @format */

;(function () {
	'use strict'

	// Your code here...
	const YU_LOCATION_HOST = location.host,
		YU_WBE_TYPE = {
			'zhuanlan.zhihu.com': 'zhihu',
			'www.xjishu.com': 'xjishu',
			'www.coze.com': 'coze',
			'www.coze.cn': 'coze',
		},
		// 上下班定时提示
		YU_REMIND_Time = [{hour: 9, minute: 25},{hour: 18, minute: 35}]
	let YU_interval = null,
		YU_intervalCount = 5

	try {
		// 根据websiteType的值执行相应的函数
		switch (YU_WBE_TYPE[YU_LOCATION_HOST]) {
			case 'zhihu':
                YU_interval = setInterval(YU_zhihu,1000)
				break
			case 'xjishu':
                YU_interval = setInterval(YU_xjishu,1000)
				break
			case 'coze':
                YU_interval = setInterval(YU_coze,3000)
				break
			default:
				YU_log('当前网页不在已处理网站规则内，如果需要处理，请把具体需求告诉我')
		}
	} catch (error) {
		YU_log(error)
	}

	function YU_coze() {
		// 关闭登录弹框
		YU_intervalCount--
		const header = document.querySelector('.semi-spin-children > div')
		const container = document.querySelector('.sidesheet-container')
		if( header || container ){
			header && (header.style.display = 'none')
			container && (container.style.gridTemplateColumns = '10fr 20fr')
			YU_intervalCount = -1
		}
        if(YU_intervalCount<=0){
            clearInterval(YU_interval)
            YU_interval = null
        }
	}

	function YU_xjishu() {
		// 显示完整内容
		YU_intervalCount--
		const conBox = document.querySelector('.con-box')
		if( conBox ){
			conBox.style = ''
			YU_intervalCount = -1
		}
        if(YU_intervalCount<=0){
            clearInterval(YU_interval)
            YU_interval = null
        }
	}

	function YU_zhihu() {
		// 关闭登录弹框
		YU_intervalCount--
		const modalLogin = document.querySelector('.Modal-closeButton')
		modalLogin && modalLogin.click()
        if(YU_intervalCount<=0){
            clearInterval(YU_interval)
            YU_interval = null
        }
	}

    if (YU_REMIND_Time && YU_REMIND_Time.length) {
        var bell;

        function setBell(interval) {
            if(bell) {
                clearInterval(bell);
            }
            return setInterval(checkTime, interval);
        }

        function checkTime() {
            var date = new Date();
            var nowMinutes = date.getMinutes() + date.getHours() * 60;

            for(var i=0; i<YU_REMIND_Time.length; i++) {
                var remindTime = YU_REMIND_Time[i];
                var remindMinutes = remindTime.minute + remindTime.hour * 60;
                var diffMinutes = remindMinutes - nowMinutes;

                // 转为明天的提醒时间
                if(diffMinutes < 0) {
                    diffMinutes += 24 * 60;
                }

                // 设定提醒并调整检查频率
                if(diffMinutes > 24 * 60) { // if more than 1 day
                    bell = setBell(24 * 60 * 60 * 1000); // check every 24 hours
                } else if(diffMinutes > 60) { // if more than 1 hour
                    bell = setBell(20 * 60 * 1000); // check every 20 minutes
                } else if(diffMinutes > 20) { // if more than 20 minutes
                    bell = setBell(5 * 60 * 1000); // check every 5 minutes
                } else if(diffMinutes > 5) { // if more than 5 minutes
                    bell = setBell(60 * 1000); // check every 1 minute
                } else if(diffMinutes <= 5 && diffMinutes >= 0) { // if now
					alert('现在是'+ date.getHours() +'点' + date.getMinutes() + '分了。');
                    // clear mark and set to check every 24 hours
                    bell = setBell(24 * 60 * 60 * 1000);
                }
				YU_log(JSON.stringify(remindTime) ,diffMinutes)
            }
        }

        // 初始检查时间
        bell = setBell(0);
    }

	function YU_log() {
		for (let arg of arguments) {
			// console.log(`（小饭桶插件提示）${arg}`)
		}
	}
})()